MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "The Calibre RET Flow Tool is a CalibreWORKbench utility that is the central access point for all the major Calibre RET lithography tools.");
MGCAddSnippet(5, "There are a number of fundamental concepts that are used by the Calibre RET Flow Tool.");
MGCAddSnippet(6, "The Calibre RET Flow Tool is part of Calibre WORKbench and Calibre LITHOview. You must be able to run either Calibre WORKbench or Calibre LITHOview (referred to generically as  a viewer ). The RET Flow Tool does not require a separate license.");
MGCAddSnippet(7, "The Calibre RET Flow Tool is organized along a flow of related tool sessions. A tool session is your particular settings for a Calibre lithography tool such as Calibre nmOPC or Calibre OPCverify.");
MGCAddSnippet(8, "The Calibre RET Flow Tool can be used in several key RET workflows.");
MGCAddSnippet(9, "One of the common uses of the RET Flow Tool is to perform correction and verification on portions of a layout. This flow illustrates the use of the RET Flow Tool with the Calibre nmOPC and Calibre OPCverify products to perform correction and verification on an example layout.");
MGCAddSnippet(10, "The RET Flow Tool performs SRAF placement development within a portion of a layout. ");
MGCAddSnippet(11, "Each supported RET product has its own session type in the RET Flow Tool. Each session in a flow represents a particular configuration of a major RET tool for a particular run.");
MGCAddSnippet(12, "Sessions correspond to running one of the Calibre RET tools. A flow consists of a set of sessions. Although it is more typical to extract sessions from an SVRF rule file, you can also create sessions with no previous setup file.");
MGCAddSnippet(13, "The Basic Simulation tool for Calibre WORKbench functionality has been converted to the new RET Flow Tool v2.0. ");
MGCAddSnippet(14, "When you select nmOPC as one of your sessions, you access the Calibre nmOPC tool. This session uses a Calibre nmOPC-based setup file and contains settings for simulation tools.");
MGCAddSnippet(15, "You must properly set up a Calibre nmOPC run in order to produce corrected results for your layout.");
MGCAddSnippet(16, "Calibre WORKbench and Calibre LITHOview support a number of core Calibre nmOPC operations. For instance, there are different types of analysis that can be performed on the results of an OPC run, as well as options to adjust how data is displayed.");
MGCAddSnippet(17, "For processes that require multiple masks to create a desired image (as in phase-shift masks or double-exposure masks), use correction layers. ");
MGCAddSnippet(18, "When you select OPCverify as one of your sessions, you access the Calibre OPCverify tool. Sessions of type OPCVERIFY use a Calibre OPCverify-based setup file and contain settings for simulation tools.");
MGCAddSnippet(19, "A Calibre OPCverify session must be correctly loaded and configured before you can use it to perform verification tasks.");
MGCAddSnippet(20, "A Calibre OPCverify session contains a number of GUI controls that run tools using the conditions in defined in the session.");
MGCAddSnippet(21, "When you select PxOPC as one of your sessions, you access the Calibre pxOPC inverse lithography tool. This session uses a Calibre pxOPC-based setup file to perform simulation.");
MGCAddSnippet(22, "You must set up a session in order to run Calibre pxOPC on the layout.");
MGCAddSnippet(23, "A Calibre pxOPC session contains a few of the common GUI controls.");
MGCAddSnippet(24, "When you select nmSRAF as one of your sessions, you access the Calibre nmSRAF tool. This session uses a Calibre nmSRAF-based setup file and contains settings for simulation tools.");
MGCAddSnippet(25, "A Calibre nmSRAF session must be correctly loaded and configured before you can use it to perform SRAF treatment on your design.");
MGCAddSnippet(26, "A Calibre nmSRAF session contains GUI controls that run tools using the conditions defined in the session.");
MGCAddSnippet(27, "This procedure explores the steps for executing Calibre nmSRAF for dimensional- and model-based SRAF generation (cnsraf and mbsraf, respectively) on a double-patterning design.");
MGCAddSnippet(28, "Generating SRAFs with cnsraf and mbsraf can be done with the RET Flow Tool.");
MGCAddSnippet(29, "This section guides you through the steps to display the gradient maps superimposed on your layout using Calibre WORKbench.");
MGCAddSnippet(30, "This section guides you through the steps to draw a cutline and display the resulting aerial intensity plot using Calibre WORKbench.");
MGCAddSnippet(31, "When you select nmBIAS as one of your sessions, you access the Calibre nmBias tool. This session uses a Calibre nmBias-based setup file and contains settings for simulation tools.");
MGCAddSnippet(32, "A Calibre nmBias session must be correctly loaded and configured before you can use it to perform biasing on your design.");
MGCAddSnippet(33, "A Calibre nmBias session contains a number of GUI controls that run tools using the conditions defined in the session.");
MGCAddSnippet(34, "When you select an OPCpro session, you access the Calibre OPCpro tool. This session uses a Calibre OPCpro-based setup file and contains settings for simulation tools.");
MGCAddSnippet(35, "A Calibre OPCpro session must be correctly loaded and configured before you can use it to perform OPC. Calibre OPCpro sessions show in the RET Flow Tool pane as session type OPC.");
MGCAddSnippet(36, "A Calibre OPCpro session contains a number of GUI controls that run tools using the conditions in defined in the session.");
MGCAddSnippet(37, "The EPE tool measures edge placement errors by placing an OPCpro-style control site placed on the edge of a polygon. ");
MGCAddSnippet(38, "When you select nmMPC as one of your sessions, you access the Calibre nmMPC tool for mask-based corrections. This session uses a Calibre nmMPC-based setup file and contains settings for simulation tools.");
MGCAddSnippet(39, "You must properly set up a Calibre nmMPC run in order to produce corrected results for your mask layout.");
MGCAddSnippet(40, "Calibre WORKbench supports a number of core Calibre nmMPC operations. For instance, there are different types of analysis that can be performed on the results of an MPC run, as well as options to adjust how data is displayed.");
MGCAddSnippet(41, "When you select MPCverify as one of your sessions, you access the Calibre MPCverify tool. Sessions of type MPCVERIFY use a Calibre MPCverify-based setup file and contain settings for simulation tools.");
MGCAddSnippet(42, "A Calibre MPCverify session must be correctly loaded and configured before you can use it to perform verification tasks.");
MGCAddSnippet(43, "A Calibre MPCverify session contains a single GUI control that runs the tool using the conditions defined in the session.");
MGCAddSnippet(44, "When you select DSAnmOPC or DSAOPCVerify as one of your sessions, you access the Calibre DSA tools for creating directed self-assembly (DSA) models. These sessions use the Calibre RET Flow tool to manage Calibre DSA sessions.");
MGCAddSnippet(45, "You must load a Calibre DSA nmOPC file in the RET Flow Tool and configure it before you can produce results in the layout.");
MGCAddSnippet(46, "You must load a Calibre DSA OPCverify file in the RET Flow Tool and configure it before you can produce results in the layout.");
MGCAddSnippet(47, "There are a number of operations that are shared across the sessions in the RET Flow Tool.");
MGCAddSnippet(48, "Calibre WORKbench and Calibre LITHOview use text files to configure important values and flags as input for multiple tools. Several tools in the RET Flow Tool have their own version of a setup file (.setup and .in extensions are typical). Each Calibre tool may have a setup file that is not cross-compatible with other Calibre tools.");
MGCAddSnippet(49, "The Setup File Editor has two functional areas: the main setup file display field and two tabs, Layers Mapping and Description, at the bottom left corner of the window. You can edit the setup file directly in the main display field.");
MGCAddSnippet(50, "You can load a self-contained setup file into your current session from the File menu of the RET Flow Tool.");
MGCAddSnippet(51, "You can extract the text of a setup file an output using the File menu of the RET Flow Tool. The RET Flow tool not only extracts the LITHO, RET, or MPC block, but also automatically loads it into the appropriate session tool. For example, if a Calibre OPCverify LITHO block is extracted, it is automatically added as an OPCverify session.");
MGCAddSnippet(52, "You can extract the text of a litho setup file from SVRF using the File menu of the RET Flow Tool. The RET Flow tool not only extracts the LITHO FILE block, but also automatically loads it into the appropriate session tool. For example, if a Calibre OPCverify LITHO block is extracted, it is automatically added as an OPCverify session.");
MGCAddSnippet(53, "If you want to create a new setup file, you can start from a default generated by Calibre WORKbench.");
MGCAddSnippet(54, "You can save your current setup file from the File menu of the RET Flow Tool.");
MGCAddSnippet(55, "Viewing large OASIS layouts in Calibre WORKbench consumes less time and resources using disk-based viewing than attempting to load an entire layout using File > Open Layout Files. Disk-based viewing loads large layouts using a view-only, disk-resident, indexed file. An artificial top cell disk_res_* is generated and the original design cell is placed beneath this new top cell. ");
MGCAddSnippet(56, "Many sessions require various types of models that can be specified in a setup file.");
MGCAddSnippet(57, "ILT uses Calibre nmOPC to perform inverse lithographic OPC correction. It is the most efficient way to run a nmOPC operation from the viewer.");
MGCAddSnippet(58, "The Map tool creates a contour map of the aerial image. This map is a representation of the light intensity at the specified defocus start value, normalized between 0 and 1, although it can be greater than 1. The Map tool sums transmission values for all overlapping polygons on multiple OPC layers. ");
MGCAddSnippet(59, "The Print Image (PI) tool simulates geometries on OPC layers that lie fully or partially within a selected area.");
MGCAddSnippet(60, "The Cutline tool lets you compare one or more simulations along cutlines you define. It sums transmission values for overlapping polygons on multiple OPC layers.");
MGCAddSnippet(61, "The Cutline tool is available with all session types. This task describes the steps to run the Cutline tool. ");
MGCAddSnippet(62, "You can specify different simulation and display properties for your cutline by using Re-Cutline in the RET Flow Tool.");
MGCAddSnippet(63, "The slope of an intensity graph provides useful information about the sharpness of an image. This information is available in the Cutline tool. ");
MGCAddSnippet(64, "You can determine the CD and threshold value at any point in a cutline graph displayed in the Cutline tool.");
MGCAddSnippet(65, "The Calibre RFT has an enhanced 2D resist cutline profiling functionality for users who have 3D resist-enabled models. The toploss resist model intensity view shows a heat map-based side view of the resist film underneath the top-down view of the resist film for 1D cutlines.");
MGCAddSnippet(66, "The Frag tool calculates values and shows how edges are fragmented for OPC. When an OPC run is performed, each polygon edge is first divided into smaller fragments, and then each individual fragment is moved in order to apply correction to the simulation.");
MGCAddSnippet(67, "Use the Frag tool to show how edges are fragmented in your layout.");
MGCAddSnippet(68, "Once you have generated the fragments, you can set their general display properties.");
MGCAddSnippet(69, "You can set the display properties for tagged groups of fragments, providing them with unique colors for easier identification on the layout.");
MGCAddSnippet(70, "The FInfo tool provides detailed EPE information on fragments.");
MGCAddSnippet(71, "Each fragment in your layout contains information that can be useful for analysis. Use FInfo to display fragment information.");
MGCAddSnippet(72, "You can view the EPE information for a selected fragment in the Fragment Information dialog box.");
MGCAddSnippet(73, "You can find all the tag groups that your selected fragment belongs to through the Fragment Information dialog box.");
MGCAddSnippet(74, "Calibre WORKbench can present side-by-side the OPC fragmentation information of selected iterations (for example, to inspect EPE trends). ");
MGCAddSnippet(75, "Use the RET Flow Tool fragment debugger to iteratively trace through a tagging script. The tool displays any fragments that a particular rule selects.");
MGCAddSnippet(76, "Viewing the possible results of a Calibre nmOPC, Calibre MPC, Calibre nmSRAF, or Calibre mbSRAF run across multiple parameter values helps you see potential hotspots in your design. The Sweeping Tool generates a range of outcomes using combinations of the parameters you specify.");
MGCAddSnippet(77, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

